import {
  LayerGroup,
  LayersControl,
  Marker,
  Tooltip,
  TileLayer,
  Popup,
} from "react-leaflet";
import { L, Icon } from 'leaflet';
import green from '../../assets/images/green.png';
import red from '../../assets/images/red.png';
import blue from '../../assets/images/blue.png';


const Map = ({ zoom, coords }) => {

  return (
    <LayersControl position="topright">
      <LayersControl.BaseLayer checked name="Basemap">
        <TileLayer url="tiles/{z}/{x}/{y}.png" noWrap={true} />
      </LayersControl.BaseLayer>

      <Marker position={[-98, 65]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Rockholm
        </Popup>
      </Marker>

      <Marker position={[-125, 75]} icon={new Icon({
            iconUrl: green,

            iconSize: [38, 95],
            iconAnchor: [22, 94],
            popupAnchor: [-3, -76]
      })}>
        <Popup>
          Midgraad
        </Popup>
      </Marker>

    </LayersControl>
  );
};
export default Map;
